summary:
{'sentences': ['The Dime Bank recently announced its sponsorship of the Pennsylvania Council on Financial Literacy’s free “Spring Semester Personal Budgeting & Investing Challenges” campaign through Brighter Financial Futures for all Pike County students in grades 3-12.', 'Students with the highest scores in the Personal Budgeting Challenge & the highest portfolio values in the Investing Challenge all win prizes.

', 'More information about The Dime Bank Personal Budget Competitions & Investing Challenge can be found at penncfl.org/wayne-and-pike-county.', 'Schools can sign up for the Budgeting & Investing competitions at penncfl.org.

', 'According to the company, students can learn how to maintain a budget, pay monthly bills, build credit, and invest in the market through hands-on simulations.']}
